import React, { useState } from 'react';
import { Text, View, TouchableOpacity, StyleSheet,TextInput, Alert, SafeAreaView } from 'react-native';
import Lista from '../../components/Lista/Lista';
import estiloColecao from './estiloColecao';
import { MaterialIcons } from '@expo/vector-icons'
import { AntDesign } from '@expo/vector-icons'

function Colecao({ navigation, route }) {

const voltar = () => {
navigation.navigate('Inicial')
}
return (
<View style={estiloColecao.container}>

	<View style={estiloColecao.header}>
		<TouchableOpacity onPress={voltar}>
			<MaterialIcons name="arrow-back" size={24} color="#fff" />
		</TouchableOpacity>
		<Text style={estiloColecao.texto}>Contato</Text>
	</View>

	<View style={estiloColecao.formulario}>
		<View style={estiloLogin.campoContainer}>
			<MaterialIcons name="person" size={24} color="#2d2d2d" />
			<TextInput
			placeholderTextColor="#666"
			style={estiloLogin.campo}
			placeholder="Login"
			onChangeText={login => setLogin(login)}
			value={login}
			/>
		</View>

		<View style={estiloLogin.campoContainer}>
			<MaterialIcons name="vpn-key" size={24} color="#2d2d2d" />
			<TextInput
			placeholderTextColor="#666"
			style={estiloLogin.campo}
			placeholder="Senha"
			onChangeText={senha => setSenha(senha)}
			value={senha}
			/>
		</View>

		<View style={estiloLogin.buttonsC}>
			<TouchableOpacity onPress={entrar}>
				<LinearGradient colors={['#A1C3F2', '#9DB1EA']} style={estiloLogin.botaoLinearGradient}>
					<Text style={estiloLogin.botaoTexto}>Entrar</Text>
				</LinearGradient>
			</TouchableOpacity>

			<TouchableOpacity onPress={entrar}>
				<LinearGradient colors={['#A1C3F2', '#9DB1EA']} style={estiloLogin.botaoLinearGradient}>
					<Text style={estiloLogin.botaoTexto}>Cadastro</Text>
				</LinearGradient>
			</TouchableOpacity>
		</View>
	</View>
</View>
	)
}
export default Colecao;
